import { useParams } from "react-router-dom";
import { useContext } from "react";
import AuthContext from "../store/auth-context";

const VideoPage=()=>{
    const params = useParams()
    const { idVideo } = params;
    const authCtx=useContext(AuthContext)
    let catVideos=[];
    let catForCategory=[];
    let catForCat=[];
    const propertysValues = Object.values(authCtx.videos);
      catVideos.push(...propertysValues)
    let videoForCategory= catVideos.filter((f)=>(f.link)===idVideo);
    catForCategory.push(videoForCategory[0])
    catForCat.push(...catForCategory)
    console.log(catForCat)
    return(
        <h1>{idVideo}</h1>
    )
}

export default VideoPage;
